        def editProfile(self):
                try:
                        dapatId = self.labelId.text()
                        if self.radioButton_2.isChecked():
                                gender = 'Laki-laki'
                        else:
                                gender = 'Perempuan'
                        
                        mydb = mc.connect(
                                 host = "localhost",
                                 user = "root",
                                 password = "",
                                 database = "inovasiKreatif"
                                 )
                         
                        mycursor = mydb.cursor()
                        query = "UPDATE akun SET nama = %s, email = %s, password = %s, gender = %s, alamat = %s, noHp = %s, status = %s WHERE id = " + dapatId
                        value = (self.lineEdit.text(), self.lineEdit_2.text(), self.lineEdit_3.text(), gender, self.pAlamat_3.toPlainText(), self.lineEdit_4.text(), self.lineEdit_5.text())
                        print("Sukses: Update Profile")
                        QMessageBox.information(self, 'Berhasil Update', 'Profile berhasil di Update!')
                        mycursor.execute(query, value)
                        mydb.commit()
                        
                except mc.Error as e:
                        print("ERROR: Query")
                        
