        def lihatIde(self):
                try:
                        dapatId = self.labelId.text()
                        mydb = mc.connect(
                                host = "localhost",
                                user = "root",
                                password = "",
                                database = "inovasiKreatif"
                                )
                        
                        mycursor = mydb.cursor()
                        query = "SELECT noIde, judul, deskripsi, organisasi, jmlAnggota, tglSubmit FROM ideInovasi"
                        mycursor.execute(query)
                        result = mycursor.fetchall()
                        self.tblListIde.setRowCount(0)
                        
                        for row_number, row_data in enumerate(result):
                                self.tblListIde.insertRow(row_number)
                                for column_number, data in enumerate(row_data):
                                        self.tblListIde.setItem(row_number, column_number, QTableWidgetItem(str(data)))
                                
                except mc.Error as e:
                        print("MYSQL ERROR")
                        
        def progressIde(self, idAkun):
                try:
                        dapatId = idAkun
                        mydb = mc.connect(
                                host = "localhost",
                                user = "root",
                                password = "",
                                database = "inovasiKreatif"
                                )
                                
                        mycursor = mydb.cursor()
                        query = "SELECT noIde, judul, deskripsi, organisasi, jmlAnggota, tglSubmit, status FROM ideInovasi WHERE idAkun = " + dapatId
                        mycursor.execute(query)
                        result = mycursor.fetchall()
                        self.tblProgIde.setRowCount(0)

                        for row_number, row_data in enumerate(result):
                                self.tblProgIde.insertRow(row_number)
                                for column_number, data in enumerate(row_data):
                                        self.tblProgIde.setItem(row_number, column_number, QTableWidgetItem(str(data)))
                                
                except mc.Error as e:
                        print("MYSQL ERROR")
                  
